  var newStr = str.replace(/=/g, ":");
  var newStr1 = newStr.replace(/{/g, "");
  var newStr2 = newStr1.replace(/}/g, "");
  var newStr3 = newStr2.replace(/\[/g, "");
  var newStr4 = newStr3.replace(/]/g, "");
  var newStr5 = newStr4.replace(/, /g, ",");

  outputs.new_string = newStr5;
})(inputs, outputs);

