sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var appName = inputs.str;

var sp = inputs.split;

var countParts = (appName.match(/:/g) || []).length;

var partsArray = appName.split(sp);



var parts1 = partsArray[0];
var parts2 = partsArray[1];
var parts3 = partsArray[2];
var parts4 = partsArray[3];
var parts5 = partsArray[4];
var parts6 = partsArray[5];
var parts7 = partsArray[6];
var parts8 = partsArray[7];  
var parts9 = partsArray[8];
var parts10 = partsArray[9];
var parts11 = partsArray[10];
var parts12 = partsArray[11];  


outputs.parts1 = parts1;
outputs.parts2 = parts2;
outputs.parts3 = parts3;
outputs.parts4 = parts4;
outputs.parts5 = parts5;
outputs.parts6 = parts6;
outputs.parts7 = parts7;
outputs.parts8 = parts8;  
outputs.parts9 = parts9;
outputs.parts10 = parts10;
outputs.parts11 = parts11;
outputs.parts12 = parts12;
})(inputs, outputs);

